import React from 'react';
import styled from 'styled-components'

const Header = () => {
    return (
        <HeaderContainer>

        <HeaderImg>
            <img src='./images/header-pic2.jpg' alt='Header Image' />
        </HeaderImg>
        
        </HeaderContainer>
    )
};

const HeaderContainer = styled.div`

`
const HeaderImg = styled.div`
max-width: 100vw;
height: 800px;

img {
    width:100%;
    height:100%;
    object-fit: cover;
}

`

export default Header;
